import React, { useState } from 'react';
import { useSession } from '../session';
import { useNavigate } from 'react-router-dom';
const wilayaOptions = [
  "Adrar", "Assaba", "Brakna", "Dakhlet Nouadhibou", "Gorgol",
  "Guidimaka", "Hodh Ech Chargui", "Hodh El Gharbi", "Inchiri", 
  "Nouakchott-Nord", "Nouakchott-Ouest", "Nouakchott-Sud", 
  "Tagant", "Tiris Zemmour", "Trarza"
];

const typeSangOptions = [
  "A+", "A-", "B+", "B-", "AB+", "AB-", "O+", "O-"
];

function SignUpForm() {
  const navigate = useNavigate();
  const {isLoggedIn} = useSession();
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    tel: '',
    username: '',
    email: '',
    wilaya: '',
    type_sang: '',
    password: '',
    password_confirm: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  if(isLoggedIn){
    navigate("/");
  }

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://127.0.0.1:8000/register/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error('Une erreur s\'est produite lors de l\'inscription.');
      }

      console.log('Utilisateur inscrit avec succès.');
      
      navigate("/",{ replace: true })
      
      // Réinitialiser le formulaire après inscription réussie si nécessaire
    } catch (error) {
      console.error('Erreur lors de l\'inscription:', error.message);
    }
  };

  return (
    
    <div>
      <div>
        <h2>Inscription</h2>
        <form onSubmit={handleSubmit}>
          <div>
            <label for="first_name">Prénom</label>
            <input
              type="text"
              id="first_name"
              name="first_name"
              value={formData.first_name}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="last_name">Nom de famille</label>
            <input
              type="text"
              id="last_name"
              name="last_name"
              value={formData.last_name}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="tel">Téléphone</label>
            <input
              type="tel"
              id="tel"
              name="tel"
              value={formData.tel}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="username">Nom d'utilisateur</label>
            <input
              type="text"
              id="username"
              name="username"
              value={formData.username}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div>
          <label htmlFor="type_sang">Type de sang</label>
          <select
            id="type_sang"
            name="type_sang"
            value={formData.type_sang}
            onChange={handleChange}
            required
          >
            <option value="">Sélectionnez un type de sang</option>
            {Object.entries(typeSangOptions).map(([typeSang, value]) => (
              <option key={value} value={value}>{typeSang}</option>
            ))}
          </select>
        </div>

        <div>
          <label htmlFor="wilaya">Wilaya</label>
          <select
            id="wilaya"
            name="wilaya"
            value={formData.wilaya}
            onChange={handleChange}
            required
          >
            <option value="">Sélectionnez une wilaya</option>
            {Object.entries(wilayaOptions).map(([wilaya, value]) => (
              <option key={value} value={value}>{wilaya}</option>
            ))}
          </select>
        </div>
          <div>
            <label for="password">Mot de passe</label>
            <input
              type="password"
              id="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="password_confirm">Confirmer le mot de passe</label>
            <input
              type="password"
              id="password_confirm"
              name="password_confirm"
              value={formData.password_confirm}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit">S'inscrire</button>
        </form>
      </div>
    </div>

  );
}

export default SignUpForm;
